scriptlet.script:
var str = scriptletInput; //Get the input

//regex to remove SystemID
var replace = /"SystemID":"[0-9]*"/; 
str = str.replace(replace, "\"SystemID\":\"\"");

//regex to remove primaryname - the hostname_value will be removed in a later filter
replace = /"PrimaryName":"\w*",/;
str = str.replace(replace, "\"PrimaryName\":\"hostname_value\",");

//Creating todays date dd.mm.yyyy
var today = new Date();
var dd = today.getDate();
if ( dd < 10 ) dd = '0' + dd;

var mm = today.getMonth()+1;
if ( mm < 10 ) mm = '0' + mm;

var yyyy = today.getFullYear();
if ( yyyy < 10 ) yyyy = '0' + yyyy;


var replace = /"Ordered on: dd.mm.yyyy/g; 
str = str.replace(replace, "\"Ordered on: " + dd + "." + mm + "." + yyyy);

var newstr =str;


scriptletResult = newstr;
//scriptletResult = "Timestamp:"+new java.util.Date()+"\n"+scriptletInput+"\n"+scriptletInput.length+" characters"

